    public static boolean searchMatrix(int[][] matrix, int target) {
        if(matrix.length==0 || matrix[0].length==0) {
            return false;
        }
        return binarySearch(matrix, target, 0, matrix.length-1, 0, matrix[0].length-1);
    }

    private static boolean binarySearch(int[][] matrix, int target, int rowBegin, int rowEnd, int colBegin, int colEnd) {
        if (rowBegin >= rowEnd && colBegin >= colEnd) {
            return matrix[rowBegin][colBegin] == target;
        }

        int rowMid = rowBegin + ((rowEnd - rowBegin) >> 1);
        int colMid = colBegin + ((colEnd - colBegin) >> 1);
        if (matrix[rowMid][colMid] == target) {
            return true;
        }

        if (matrix[rowMid][colMid] > target) {
            if (rowMid == rowBegin && colMid == colBegin) {
                return false;
            }
            if (rowMid == rowBegin) {
                return binarySearch(matrix, target, rowBegin, rowBegin, colBegin, colMid - 1);
            }
            if (colMid == colBegin) {
                return binarySearch(matrix, target, rowBegin, rowMid - 1, colBegin, colBegin);
            }
            return binarySearch(matrix, target, rowBegin, rowMid - 1, colBegin, colMid - 1)
                    || binarySearch(matrix, target, rowBegin, rowMid - 1, colMid, colEnd)
                    || binarySearch(matrix, target, rowMid, rowEnd, colBegin, colMid - 1);
        }

        // matrix[rowMid][colMid]<target
        if (rowMid == rowEnd && colMid == colEnd) {
            return false;
        }
        if (rowMid == rowEnd) {
            return binarySearch(matrix, target, rowEnd, rowEnd, colMid + 1, colEnd);
        }
        if (colMid == colEnd) {
            return binarySearch(matrix, target, rowMid + 1, rowEnd, colEnd, colEnd);
        }
        return binarySearch(matrix, target, rowMid + 1, rowEnd, colMid + 1, colEnd)
                || binarySearch(matrix, target, rowBegin, rowMid, colMid + 1, colEnd)
                || binarySearch(matrix, target, rowMid + 1, rowEnd, colBegin, colMid);
    }
